{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.4.0"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":115336,"databundleVersionId":13766970,"sourceType":"competition"}],"dockerImageVersionId":30749,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/xinyunchoong/group07-teo-aada-xy?scriptVersionId=262768086\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"**Introduction**\n\nIn this project we tried to predict physical activity from signals. Signals are sequences of measurements that change over time. In this project, signals were measured using a smartphone accelerator and a gyroscope. We wanted to predict three static postures (standing, sitting, lying) and three dynamic activities (walking, walking downstairs and walking upstairs) as well as postural transitions from signal data. As computers can only reflect signals in discrete samples, we have split the continuous timeframe data in epochs. We have chosen epochs as our units of measurement in order to delimitate the beginning and the end of an activity. Epochs reflect consecutive time windows and thus are suitable for this purpose. \n\nIn order to recognize patterns from signals, we extracted time-domain and spectral-domain features from signals. We explain out reasoning behind our feature signals below. \n\n\nWhat kind of data\nWhat features\nWhich models\n\n\n","metadata":{}},{"cell_type":"markdown","source":"Importing Data ","metadata":{}},{"cell_type":"code","source":"library(tidyverse) \noptions(width=100) \n\nsystem(paste0(\"cp -r \", list.files(\"../input\", full.names=TRUE), \"/* ./\"))\n\n# Train and Test folder are located in the RawData folder\nlist.files(\"../input/RawData\")\n\n# The Train folder contains 85 files:\nlength(list.files(\"./RawData/Train\"))\n\n# A sample of the file names in the Train folder; notice the filename pattern\nset.seed(1)\nsample(list.files(\"./RawData/Train\"),6)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:06.99398Z","iopub.execute_input":"2025-09-19T09:10:06.995936Z","iopub.status.idle":"2025-09-19T09:10:12.037999Z","shell.execute_reply":"2025-09-19T09:10:12.036265Z"}},"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5\n\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.5.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.1\n\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"","text/markdown":"","text/latex":"","text/plain":"character(0)"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"85",