l_names = FALSE, col_types = \"ddd\")\n\noptions(repr.plot.width=12)\n\nplot.ts(user01, xlab=\"Sample number\")\n\nprint(labels[1:2,])\n\nsample_labels <- labels |>\n  mutate(segment = row_number()) |>         # identify each separate activity interval\n  reframe(\n    sampleid = seq.int(start, end),          # expand start:end into all sample IDs\n    .by = c(trial, userid, act_code, activity, segment)\n  )\n\nuser_df = \n  tibble(userid = username, trial = expname, sampleid = seq.int(0, nrow(user01) - 1)) |>\n  bind_cols(user01) |>\n  left_join(sample_labels, by = c(\"userid\", \"trial\", \"sampleid\"))\n\n# Check the result (first few rows are not interesting; the following are)\nprint(user_df[1227:1239, ])\n\noptions(repr.plot.width = 15)  # widen the plot for readability\n\nuser_df %>%\n  filter(!is.na(activity)) %>%    # keep only labeled samples\n  ggplot(aes(x = sampleid, y = X1, colour = factor(activity), group = segment)) +\n  geom_line()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:12.089411Z","iopub.execute_input":"2025-09-19T09:10:12.090875Z","iopub.status.idle":"2025-09-19T09:10:14.173981Z","shell.execute_reply":"2025-09-19T09:10:14.171202Z"}},"outputs":[{"name":"stdout","text":"\u001b[90m# A tibble: 2 × 6\u001b[39m\n  trial userid act_code start   end activity    \n  \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m  \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m    \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m       \n\u001b[90m1\u001b[39m     1      1        5   250  \u001b[4m1\u001b[24m232 STANDING    \n\u001b[90m2\u001b[39m     1      1        7  \u001b[4m1\u001b[24m233  \u001b[4m1\u001b[24m392 STAND_TO_SIT\n\u001b[90m# A tibble: 13 × 9\u001b[39m\n   userid trial sampleid    X1     X2     X3 act_code activity     segment\n    \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m \u001b[3m\u001b[90m