ata":{"image/png":{"width":900,"height":420}}}],"execution_count":4},{"cell_type":"markdown","source":"**Time domain features**\n\n1. Signal features\n2. Mean\n3. SD\n4. Median\n5. Min\n6. Max\n7. Range\n8. IQR\n9. Covariance \n10. Quantiles\n11. Skew\n12. Kurtosis - severity of the tailedness of the signal\n13. Power - average squared amplitude of the signal, how much it deviates from 0.\n14. Entropy - measure of average \"surprise\", higher entropy indicating more unpredictability in the signal's patterns\n15. Signal energy - total power of the samples. Sum of squares formula used to estimate \"intensity\" of the activity, which can be used for distinguishing walking from\n16. Sign changes - counts how many times a signal changes its sign (from + to -),and can help distinguish lying down from standing \n17. Lagged correlation - computes the correlation between x and a time shifted y\n\n","metadata":{}},{"cell_type":"code","source":"# Helper functions\nmost_common_value = function(x) {\n    counts = table(x, useNA='no')\n    most_frequent = which.max(counts)\n    return(names(most_frequent))\n}\n\n## Feature functions (time domain)\n\n# Lagged correlation\nlagged_cor = function(x, y=x, lag=0) {\n    r_lagged = cor(x, dplyr::lag(y, lag), use='pairwise')\n    return(r_lagged)\n}\n\n# Entropy\nentropy = function(x, nbreaks = nclass.Sturges(x)) {\n    r = range(x)\n    x_binned = findInterval(x, seq(r[1], r[2], len = nbreaks))\n    h = tabulate(x_binned, nbins = nbreaks)\n    p = h/sum(h)\n    -sum(p[p>0] * log(p[p>0]))\n}\n\n# Power \npower = function(x) {\n    power = mean(x^2)\n    return(power)\n}\n\n#IQR \ninterquartile_range = function(x) {\n    return(IQR(x, na.rm=T))\n}\n\n# Signal energy\nsignal_energy = function(x) {\n    return(sum(x^2)/length(x)) \n}\n\n# Sign changes\nsign_changes = function(x) {\n    sum(diff(sign(x)) != 0, na.rm = TRUE) \n}\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:17.047949Z","iopub.execute_input":"2025-09-19T09:10:17.04945Z","iopub.status.idle":"2025-09-19T09:10:17.074524Z","shell.execute_reply":"2025-09-19T09:10:17.072683Z"}},"outputs":[],"execution_count":5},{"cell_type":"code","source":"# Compute features per epoch:\n\nusertimedom = user_df |>\n\n  # add an epoch ID variable (one epoch = 2.56 sec)\n  mutate(epoch = sampleid %/% 128) |>\n\n  # extract statistical features from each epoch\n  group_by(epoch) |>\n  summarise(\n  # Activity label for the epoch = most common value (mode)\n      activity = most_common_value(c(\"-\", activity)),\n\n      # Keep starting sample ID of the epoch\n      sampleid = sampleid[1],\n\n      # Signal featuresa\n      mean_X1 = mean(X1), \n      mean_X2 = mean(X2), \n      mean_X3 = mean(X3),\n      sd_X1   = sd(X1), \n      sd_X2 = sd(X2),\n      sd_X3 = sd(X3),\n      median_X1 = median(X1),\n      median_X2 = median(X2),\n      median_X3 = median(X3),\n      min_X1 = min(X1),\n      min_X2 = min(X2),\n      min_X3 = min(X3),\n      max_X1 = max(X1),\n      max_X2 = max(X2),\n      max_X3 = max(X3),\n      range_X1 = range(X1)[2] - range(X1)[1],\n      range_X2 = range(X2)[2] - range(X2)[1],\n      rangeX3 = range(X3)[2] - range(X3)[1],\n      cov_X1X2 = cov(X1, X2),\n      cov_X1X3 = cov(X1, X3),\n      cov_X2X3 = cov(X2, X3),\n      q25_X1  = quantile(X1, .25),\n      q75_X1 = quantile(X1, .75),\n      q25_X2 = quantile(X2, .25),\n      q75_X2 = quantile(X2, .75), \n      q25_X3 = quantile(X3, .25),\n      q75_X3 = quantile(X3, .75),\n      iqr_X1 = interquartile_range(X1),\n      iqr_X2 = interquartile_range(X2),\n      iqr_X3 = interquartile_range(X3),\n      skew_X1 = e1071::skewness(X1),\n      skew_X2 = e1071::skewness(X2),\n      skew_X3 = e1071::skewness(X3),\n      kurt_X1 = e1071::kurtosis(X1),\n      kurt_X2 = e1071::kurtosis(X2),\n      kurt_X3 = e1071::kurtosis(X3),\n      power_X1 = power(X1),\n      power_X2 = power(X2),\n      power_X3 = power(X3),\n      ent_X1 = entropy(X1),\n      ent_X2 = entropy(X2),\n      ent_X3 = entropy(X3),\n      signal_energy_X1 = signal_energy(X1),\n      signal_energy_X2 = signal_energy(X2),\n      signal_energy_X3 = signal_energy(X3),\n      sign_change_X1 = sign_changes(X1),\n      sign_change_X2 = sign_changes(X2),\n      sign_change_X3 = sign_changes(X3),\n\n      \n      AR1_X1_lag1  = lagged_cor(X1, lag = 1),\n      AR1_X1_lag2  = lagged_cor(X1, lag = 2),\n      AR_X1X2_lag1 = lagged_cor(X1, X2, lag = 1),\n      AR_X1X2_lag2 = lagged_cor(X1, X2, lag = 2),\n      AR2_X2_lag1 = lagged_cor(X2, lag = 1),\n      AR2_X2_lag2 = lagged_cor(X2, lag = 2),\n      AR_X2X3_lag1 = lagged_cor(X2, X3, lag = 1),\n      AR_X2X3_lag2 = lagged_cor(X2, X3, lag = 2),\n      AR_X1X3_lag1 = lagged_cor(X1, X3, lag = 1),\n      AR_X1X3_lag2 = lagged_cor(X1, X3, lag = 2),\n      AR3_X3_lag1 = lagged_cor(X3, lag = 1),\n      AR3_X3_lag2 = lagged_cor(X3, lag = 2),\n      \n      # Keep track of signal lengths\n      n_samples = n()\n  ) \n\nhead(usertimedom)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:17.077612Z","iopub.execute_input":"2025-09-19T09:10:17.079136Z","iopub.status.idle":"2025-09-19T09:10:17.776221Z","shell.execute_reply":"2025-09-19T09:10:17.774321Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 64</caption>\n<thead>\n\t<tr><th scope=col>epoch</th><th scope=col>activity</th><th scope=col>sampleid</th><th scope=col>mean_X1</th><th scope=col>mean_X2</th><th scope=col>mean_X3</th><th scope=col>sd_X1</th><th scope=col>sd_X2</th><th scope=col>sd_X3</th><th scope=col>median_X1</th><th scope=col>⋯</th><th scope=col>AR_X1X2_lag2</th><th scope=col>AR2_X2_lag1</th><th scope=col>AR2_X2_lag2</th><th scope=col>AR_X2X3_lag1</th><th scope=col>AR_X2X3_lag2</th><th scope=col>AR_X1X3_lag1</th><th scope=col>AR_X1X3_lag2</th><th scope=col>AR3_X3_lag1</th><th scope=col>AR3_X3_lag2</th><th scope=col>n_samples</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th s