inant frequency of signal \nMean frequency of signal \nSD of signal\nSpectral entropy\nFrequency variance\nSpectral Bandpower High\nSpectral energy\nSpectrum spread","metadata":{}},{"cell_type":"code","source":"# Feature functions (frequency domain)\nmean_freq = function(freq, spec) {\n    delta_f = freq[2]-freq[1]  # gap size between frequencies\n    normalizing_constant = sum(spec * delta_f) # ≈ ∫S(f)df\n    mean_freq = sum(freq * spec * delta_f) / normalizing_constant\n    return(mean_freq)\n}\n\n# SD\nspec_sd = function(x) {\n    s = spectrum(x, log = 'n', plot = FALSE)\n    df = s$freq[2] - s$freq[1]\n    sbar = sum(s$freq * s$spec * df)\n    svar = sum((s$freq - sbar)^2 * s$spec * df)\n    sd = sqrt(svar)\n    return(sd)\n}\n\n# Spread of the spectrum, measured as a 'standard deviation'\nspectrum_spread = function(freq, spec) {\n    mean_freq = mean_freq(freq, spec) # obtains the mean frequency from another function\n    freqvar = sum((freq-mean_freq)^2 * spec * diff(freq)[1]) \n    freq_sd = sqrt(freqvar)\n    return(freq_sd)\n}\n\n# Frequency variance\ns = spectrum(user_spect_df, plot = FALSE)\nmeanfreq = sum(s$freq * s$spec * diff(s$freq)[1])\nfreqvar = function(x) {\n    s = spectrum(x, log = 'n', plot = FALSE)\n    fv = sum((s$freq-meanfreq)^2 * s$spec * diff(s$freq)[1])\n    return(fv)\n}\n\n# Spectral Bandpower High\nlibrary(broom)\nspec_bands = function(x) {\n    s = spectrum(ts(x, deltat = 1/128), span = 7, plot = FALSE)\n    bands = seq(0, max(s$freq), len = 30)\n    df = s %>%\n    tidy() %>%\n    mutate(band = findInterval(freq, bands)) %>%\n    group_by(band) %>%\n    summarise(\n        band_peak_freq = freq[which.max(spec)],\n        band_power = mean(spec),\n        .groups = 'drop')\n    return(df$band[which.max(df$band_power)])\n}\n\n# Spectral Entropy \nspec_entropy = function(x, nbreaks = nclass.Sturges(x)) {\n    s = spectrum(x, log = 'n', plot = FALSE)\n    h = s$spec\n    h <- h[!is.na(h)]\n    p = h/sum(h)\n    -sum(p[p>0] * log(p[p>0]))\n}\n\n# Spectral Energy \nspec_energy = function(freq, spec) {\n    delta_f = freq[2] - freq[1]     # this function calculates how much power the signal has\n    sum(spec * delta_f)             # this can be used to distinguish the low and high spectral energy periods (ex. lying vs running)\n}","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:18.407997Z","iopub.execute_input":"2025-09-19T09:10:18.409486Z","iopub.status.idle":"2025-09-19T09:10:18.537457Z","shell.execute_reply":"2025-09-19T09:10:18.53549Z"}},"outputs":[],"execution_count":8},{"cell_type":"code","source":"# Step 3: compute frequency-domain features per epoch\nuserfreqdom = user_spect_df %>%\n    group_by(epoch) %>%\n    summarise(\n        # Dominant frequency of signal \n        domfreq1 = freq[which.max(spec1)],\n        domfreq2 = freq[which.max(spec2)],\n        domfreq3 = freq[which.max(spec3)],\n\n        # Mean frequency of signal \n        meanfreq1 = mean_freq(freq, spec1),\n        meanfreq2 = mean_freq(freq, spec2),\n        meanfreq3 = mean_freq(freq, spec3),\n\n        # SD of signal \n        sd1 = spec_sd(spec1),\n        sd2 = spec_sd(spec2),\n        sd3 = spec_sd(spec3),\n        \n        # spectral_entropy \n        spec_ent1 = spec_entropy(spec1),\n        spec_ent2 = spec_entropy(spec2),\n        spec_ent3 = spec_entropy(spec3),\n\n        # Frequency variance\n        freq_var1 = freqvar(spec1),\n        freq_var2 = freqvar(spec2),\n        freq_var3 = freqvar(spec3),\n\n        # Spectral Bandpower High\n        spec_bands1 = spec_bands(spec1),\n        spec_bands2 = spec_bands(spec2),\n        spec_bands3 = spec_bands(spec3),\n\n        # Spectral energy\n        spec_energy1 = spec_energy(freq, spec1),\n        spec_energy2 = spec_energy(freq, spec2),\n        spec_energy3 = spec_energy(freq, spec3),\n\n        # Spectrum spread\n        spec_spread1 = spectrum_spread(freq, spec1),\n        spec_spread2 = spectrum_spread(freq, spec2),\n        spec_spread3 = spectrum_spread(freq, spec3),\n    )\n\nhead(userfreqdom)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-09-19T09:10:18.540377Z","iopub.execute_input":"2025-09-19T09:10:18.541826Z","iopub.status.idle":"2025-09-19T09:10:22.750725Z","shell.execute_reply":"2025-09-19T09:10:22.74898Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 25</caption>\n<thead>\n\t<tr><th scope=col>epoch</th><th scope=col>domfreq1</th><th scope=col>domfreq2</th><th scope=col>domfreq3</th><th scope=col>meanfreq1</th><th scope=col>meanfreq2</th><th scope=col>meanfreq3</th><th scope=col>sd1</th><th scope=col>sd2</th><th scope=col>sd3</th><th scope=col>⋯</th><th scope=col>freq_var3</th><th scope=col>spec_bands1</th><th scope=col>spec_bands2</th><th scope=col>spec_bands3</th><th scope=col>spec_energy1</th><th scope=col>spec_energy2</th><th scope=col>spec_energy3</th><th scope=col>spec_spread1</th><th scope=col>spec_spread2</th><th scope=col>spec_spread3</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>⋯</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>0</td><td>0.1328125</td><td>0.0078125</td><td>0.0234375</td><td>0.1591042</td><td>0.18724017</td><td>0.06075288</td><td>2.084464e-04</td><td>3.962627e-05</td><td>2.116784e-03</td><td>⋯</td><td>4.182811e-06</td><td>1</td><td>4</td><td>1</td><td>8.662393e-03</td><td>2.568876e-03</td><td>1.9334