mainFeatures, sample_labels)\n\nfilenames_test_gyro = list.files(\"./RawData/Test/\", \"^gyro\", full.names = TRUE)\ntest_gyro <- map_dfr(filenames_test_gyro, extractTimeDomainFeatures, sample_labels)\n\nmyTestData = test_acc %>% left_join(test_gyro, by = c('epoch', 'user_id', 'exp_id', 'activity', 'sampleid'))","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# As a stand in for the actual test data we use the first 2550 rows from myData\n\n# Apply data transformation\nmyTestData2 = myTestData |> select(-c(\"epoch\",\"sampleid\",\"user_id\",\"exp_id\",\"sampleid\"))\nmyTestData2 = predict(preproc, myTestData2)\nmyTestData2 = myTestData2 |> select(-all_of(redundant))\n\n# Apply best model to predict activity\npredicted_activity = predict(fit_knn, myTestData2)\n\n# Writing the test predictions to CSV file\nmyTestData |>\n\n    # Set `activity` to the predicted activity\n    mutate(activity = predicted_activity) |>\n\n    # prepend \"user\" and \"exp\" to user_id and exp_id\n    mutate(\n        user_id = paste(ifelse(user_id < 10, \"user0\", \"user\"), user_id, sep=\"\"), \n        exp_id = paste(ifelse(exp_id < 10, \"exp0\", \"exp\"), exp_id, sep=\"\")\n    ) |> \n\n    # unite columnes user_id, exp_id and sample_id into a string \n    # separated by \"_\" and store it in the new variable `Id`\n    unite(Id, user_id, exp_id, sampleid) |>\n\n    # retain only the `Id` and  predictions\n    select(Id, Predicted = activity) |>\n\n    # write to file\n    write_csv(\"submission.csv\")\n\n\n# Check the result: print first 20 lines in the submission file\ncat(readLines(\"submission.csv\",20), sep=\"\\n\")","metadata":{"trusted":true},"outputs":[],"execution_count":null}]}